import { productsType } from "../types/Types";
export const filterProductsData = (product: productsType[]): productsType[] => {

  const filteredUsers: productsType[] = product.map((product: productsType) => ({    
    id: product.id,
    description: product.description,
    image: product.image,
    price: product.price,
    title: product.title,
    count: 1,
  })
);

  return filteredUsers
}
